import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../../assets/logo.png';
import './Navbar.css';

export default function Navbar() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
        <div className="navbar-logo">
          <img src={logo} alt="Logo" className="logo" style={{ height: '30px', width: 'auto' }} />
        </div>
        <div className="container-fluid">
          {/* <a className="navbar-brand" href="#">MEWO</a> */}
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <Link className="btn btn-outline-light" to="/adduser">Home</Link>
          <Link className="btn btn-outline-light" to="/adduser">Customer Booth</Link>
          <Link className="btn btn-outline-light" to="/adduser">Employee Booth</Link>
          <Link className="btn btn-outline-light" to="/adduser">Admin Booth</Link>
        </div>
      </nav>
    </div>
  );
}
